content=Not all unhelped we held the fort, our tiny flags unfurled; / Some giants laboured in that cloud to lift it from the world. / I find again the book we found, I feel the hour that flings / Far out of fish-shaped Paumanok some cry of cleaner things; / And the Green Carnation withered, as in forest fires that pass, / Roared in the wind of all the world ten million leaves of grass; / Or sane and sweet and sudden as a bird sings in the rain -- / Truth out of Tusitala spoke and pleasure out of pain. / Yea, cool and clear and sudden as a bird sings in the grey, / Dunedin to Samoa spoke, and darkness unto day. / But we were young; we lived to see God break their bitter charms. / God and the good Republic come riding back in arms

